------MultipartBoundary--4mI8kfBN9CTJA0fCZwuHCm22DzKCmBbKoHLlg8lkw0----
Content-Type: text/css
Content-Transfer-Encoding: binary
Content-Location: https://tikfollowers.com/theme/default/css/style.css

@charset "utf-8";

#rating_error_alert, .customer-submit-success { display: none; }

h1, .h1, .h1 { font-size: 2.625rem !important; }

h3, .h3, .h3 { font-size: 1.25rem !important; }

h4, .h4, .h4 { font-size: 1rem !important; }

input:-webkit-autofill, input:-webkit-autofill:focus { transition: background-color 600000s ease 0s, color 600000s ease 0s; }

input[data-autocompleted] { background-color: transparent !important; }

.text-black { color: rgb(0, 0, 0); }

.text-secondary-color { color: rgb(255, 0, 128); }

.all-menu-list .nav-link { font-weight: 600 !important; }

.dropdown-menu li a { text-align: left; display: block; width: 100%; }

.dropdown-menu li a i { width: 20px; font-size: 13px; border-right: 1px solid rgb(229, 229, 229); color: rgb(237, 5, 137); }

.dropdown-item:hover, .dropdown-item:focus { color: rgb(255, 255, 255) !important; background-color: rgb(163, 28, 180) !important; }

.dropdown-item { color: rgb(0, 0, 0) !important; }

